/****** Object:  StoredProcedure [dbo].[Report_CompanyHCReservesOilDG]    Script Date: 17.03.2023 10:34:51 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

CREATE procedure [dbo].[Report_CompanyHCReservesOilDG]
		  @Year int = null
		, @Sub varchar(max) = null
		, @Company varchar(max) = null
		, @Deposit varchar(max) = null
as
begin

	set nocount on

	/* Отчет "Запасы нефти и растворенного газа дочерних и зависимых предприятий" */


	create table #reserves
		(
			  rowtype int, guid_company uniqueidentifier, GUID_Sub uniqueidentifier, GUID_Object uniqueidentifier, GUID_ObjectForName uniqueidentifier
			, OilFirstYearGeoAB1C1 float, OilFirstYearGeoB2C2 float, OilFirstYearExtAB1C1 float, OilFirstYearExtB2C2 float, OilEndYearGeoAB1 float, OilEndYearGeoB2 float, OilEndYearExtAB1 float
			, OilEndearEcoAB1 float, OilEndYearExtB2 float, OilEndearEcoB2 float, OilEndYearGeoC1 float, OilEndearGeoC2 float, OilEndYearExtC1 float, OilEndYearExtC2 float, OilProduction float, OilEndYearCumulativeProduction float
			, DGEndYearExtAB1C1 float, DGEndYearExtB2C2 float, DGEndYearExtAB1 float, DGEndYearExtB2 float, DGEndYearExtC1 float, DGEndYearExtC2 float, DGProduction float, DGEndYearCumulativeProduction float
		)

	/* по месторождению */
	insert #reserves
	select
			  3
			, b.guid_company
			, bd.guid_ssub
			, isnull(bd.guid_objects_deposit,bd.guid)
			, gofn.GUID_ObjectForName
			/* начальные нефть */
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('A','B1','C1') then isnull(zc.zapastekyeargeo,0) + isnull(zc.dobnacsnachendyear,0) end),0),0) OilFirstYearGeoAB1C1
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('B2','C2') then isnull(zc.zapastekyeargeo,0) + isnull(zc.dobnacsnachendyear,0) end),0),0) OilFirstYearGeoB2C2
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('A','B1','C1') then isnull(zc.zapastekyearizvl,0) + isnull(zc.dobnacsnachendyear,0) end),0),0) OilFirstYearExtAB1C1
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('B2','C2') then isnull(zc.zapastekyearizvl,0) + isnull(zc.dobnacsnachendyear,0) end),0),0) OilFirstYearExtB2C2
			/* годовые нефть */
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('A','B1') then zc.zapastekyeargeo end),0),0) OilEndYearGeoAB1
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('B2') then zc.zapastekyeargeo end),0),0) OilEndYearGeoB2
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('A','B1') then zc.zapastekyearizvl end),0),0) OilEndYearExtAB1
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('A','B1') then zc.zapastekyeareconomic end),0),0) OilEndearEcoAB1
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('B2') then zc.zapastekyearizvl end),0),0) OilEndYearExtB2
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('B2') then zc.zapastekyeareconomic end),0),0) OilEndearEcoB2
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('C1') then zc.zapastekyeargeo end),0),0) OilEndYearGeoC1
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('C2') then zc.zapastekyeargeo end),0),0) OilEndearGeoC2
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('C1') then zc.zapastekyearizvl end),0),0) OilEndYearExtC1
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' and kz.category in ('C2') then zc.zapastekyearizvl end),0),0) OilEndYearExtC2
			/* добыча + накопл. нефть */
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' then isnull(zc.dobicha,0) end),0),0) OilProduction
			, round(nullif(sum(case when zc.guid_sproductcomponent = 'B3EFC82F-7AB7-4220-8212-9FB49583736A' then /*isnull(zc.dobicha,0) +*/ isnull(zc.dobnacsnachendyear,0) end),0),0) OilEndYearCumulativeProduction
			/* начальные р.г. */
			, round(nullif(sum(case when zc.guid_sproductcomponent = '4C16568A-7E38-478C-9AAD-41CDA710C598' and kz.category in ('A','B1','C1') then isnull(zc.zapastekyearizvl,0) + isnull(zc.dobnacsnachendyear,0) + isnull(zc.potnacsnachendyear,0) + isnull(zc.zakachsnachendyear,0) end),0),0) DGEndYearExtAB1C1
			, round(nullif(sum(case when zc.guid_sproductcomponent = '4C16568A-7E38-478C-9AAD-41CDA710C598' and kz.category in ('B2','C2') then isnull(zc.zapastekyearizvl,0) + isnull(zc.dobnacsnachendyear,0) + isnull(zc.potnacsnachendyear,0) + isnull(zc.zakachsnachendyear,0) end),0),0) DGEndYearExtB2C2
			/* годовые р.г. */
			, round(nullif(sum(case when zc.guid_sproductcomponent = '4C16568A-7E38-478C-9AAD-41CDA710C598' and kz.category in ('A','B1') then zc.zapastekyearizvl end),0),0) DGEndYearExtAB1
			, round(nullif(sum(case when zc.guid_sproductcomponent = '4C16568A-7E38-478C-9AAD-41CDA710C598' and kz.category in ('B2') then zc.zapastekyearizvl end),0),0) DGEndYearExtB2
			, round(nullif(sum(case when zc.guid_sproductcomponent = '4C16568A-7E38-478C-9AAD-41CDA710C598' and kz.category in ('C1') then zc.zapastekyearizvl end),0),0) DGEndYearExtC1
			, round(nullif(sum(case when zc.guid_sproductcomponent = '4C16568A-7E38-478C-9AAD-41CDA710C598' and kz.category in ('C2') then zc.zapastekyearizvl end),0),0) DGEndYearExtC2
			/* добыча + накопл. р.г. */
			, round(nullif(sum(case when zc.guid_sproductcomponent = '4C16568A-7E38-478C-9AAD-41CDA710C598' then isnull(zc.dobicha,0) + isnull(zc.poteri,0) end),0),0) DGProduction
			, round(nullif(sum(case when zc.guid_sproductcomponent = '4C16568A-7E38-478C-9AAD-41CDA710C598' then /*isnull(zc.dobicha,0) + isnull(zc.poteri,0)*/ + isnull(zc.dobnacsnachendyear,0) + isnull(zc.potnacsnachendyear,0) end),0),0) DGEndYearCumulativeProduction
		from ext_balancehc b
			inner join ext_balancehc_deposit bd on bd.guid_balancehc = b.guid
			left join ext_ssub ss on ss.guid = bd.guid_ssub
			inner join ext_balancehc_zalezh bz on bz.guid_balancehc_deposit = bd.guid
			left join ext_license l on l.guid = bz.guid_license
			inner join ext_geolobject_kategzalezh kz on kz.guid_balancehc_zalezh = bz.guid
			inner join ext_balancehc_zapascategory zc on zc.guid_geolobject_kategzalezh = kz.guid
			left join ext_companys cad on cad.guid = b.guid_company
			inner join
				(
					select
							  bd.guid_balancehc
							, bd.guid_ssub
							, isnull(bd.guid_objects_deposit,bd.guid) GUID_Object
							, max(cast(bd.guid as varchar(36))) GUID_ObjectForName
						from ext_balancehc_deposit bd
						group by bd.guid_balancehc, bd.guid_ssub, isnull(bd.guid_objects_deposit,bd.guid)
				) gofn on gofn.guid_balancehc = b.guid
					and gofn.guid_ssub = bd.guid_ssub
					and gofn.GUID_Object = isnull(bd.guid_objects_deposit,bd.guid)
			inner join ext_balancehc_deposit bd2 on bd2.guid = gofn.GUID_ObjectForName
		where b.yearbalance = @year
			and kz.category in ('A','B1','B2','C1','C2')
			and zc.guid_sproductcomponent in
				(
					  'B3EFC82F-7AB7-4220-8212-9FB49583736A' /* Нефть */
					, '4C16568A-7E38-478C-9AAD-41CDA710C598' /* Растворенный газ */
				)
			and b.yearbalance >= 2016
			and b.yearbalance = @Year
			and (charindex('#' + ss.subname + '#',@Sub) <> 0 or isnull(replace(@Sub,'#',''),'') = '')
			and (charindex('#' + case when b.guid_company = '00000000-0000-0000-0000-000000000000' then 'Нераспределенный фонд' else isnull(cad.name + coalesce(' (' + cad.ownership + ')', ''),'Компания не определена') end + '#',@Company) <> 0 or isnull(replace(@Company,'#',''),'') = '')	
			and (charindex('#' + bd2.objectname + '#',@Deposit) <> 0 or isnull(replace(@Deposit,'#',''),'') = '')
		group by b.guid_company, bd.guid_ssub, isnull(bd.guid_objects_deposit,bd.guid), gofn.GUID_ObjectForName

	/* по недропользователю */
	insert #reserves
		(
			  rowtype, guid_company, guid_sub
			, OilFirstYearGeoAB1C1, OilFirstYearGeoB2C2, OilFirstYearExtAB1C1, OilFirstYearExtB2C2, OilEndYearGeoAB1, OilEndYearGeoB2, OilEndYearExtAB1
			, OilEndearEcoAB1, OilEndYearExtB2, OilEndearEcoB2, OilEndYearGeoC1, OilEndearGeoC2, OilEndYearExtC1, OilEndYearExtC2, OilProduction, OilEndYearCumulativeProduction
			, DGEndYearExtAB1C1, DGEndYearExtB2C2, DGEndYearExtAB1, DGEndYearExtB2, DGEndYearExtC1, DGEndYearExtC2, DGProduction, DGEndYearCumulativeProduction
		)
	select
			  2
			, r.guid_company
			, r.guid_sub
			/* начальные нефть */
			, sum(r.OilFirstYearGeoAB1C1)
			, sum(r.OilFirstYearGeoB2C2)
			, sum(r.OilFirstYearExtAB1C1)
			, sum(r.OilFirstYearExtB2C2)
			/* годовые нефть */
			, sum(r.OilEndYearGeoAB1)
			, sum(r.OilEndYearGeoB2)
			, sum(r.OilEndYearExtAB1)
			, sum(r.OilEndearEcoAB1)
			, sum(r.OilEndYearExtB2)
			, sum(r.OilEndearEcoB2)
			, sum(r.OilEndYearGeoC1)
			, sum(r.OilEndearGeoC2)
			, sum(r.OilEndYearExtC1)
			, sum(r.OilEndYearExtC2)
			/* добыча + накопл. нефть */
			, sum(r.OilProduction)
			, sum(r.OilEndYearCumulativeProduction)
			/* начальные р.г. */
			, sum(r.DGEndYearExtAB1C1)
			, sum(r.DGEndYearExtB2C2)
			/* годовые р.г. */
			, sum(r.DGEndYearExtAB1)
			, sum(r.DGEndYearExtB2)
			, sum(r.DGEndYearExtC1)
			, sum(r.DGEndYearExtC2)
			/* добыча + накопл. р.г. */
			, sum(r.DGProduction)
			, sum(r.DGEndYearCumulativeProduction)
		from #reserves r
		where r.rowtype = 3
		group by r.guid_company, r.guid_sub

	/* по субъекту */
	insert #reserves
		(
			  rowtype, guid_sub
			, OilFirstYearGeoAB1C1, OilFirstYearGeoB2C2, OilFirstYearExtAB1C1, OilFirstYearExtB2C2, OilEndYearGeoAB1, OilEndYearGeoB2, OilEndYearExtAB1
			, OilEndearEcoAB1, OilEndYearExtB2, OilEndearEcoB2, OilEndYearGeoC1, OilEndearGeoC2, OilEndYearExtC1, OilEndYearExtC2, OilProduction, OilEndYearCumulativeProduction
			, DGEndYearExtAB1C1, DGEndYearExtB2C2, DGEndYearExtAB1, DGEndYearExtB2, DGEndYearExtC1, DGEndYearExtC2, DGProduction, DGEndYearCumulativeProduction
		)
	select
			  1
			, r.guid_sub
			/* начальные нефть */
			, sum(r.OilFirstYearGeoAB1C1)
			, sum(r.OilFirstYearGeoB2C2)
			, sum(r.OilFirstYearExtAB1C1)
			, sum(r.OilFirstYearExtB2C2)
			/* годовые нефть */
			, sum(r.OilEndYearGeoAB1)
			, sum(r.OilEndYearGeoB2)
			, sum(r.OilEndYearExtAB1)
			, sum(r.OilEndearEcoAB1)
			, sum(r.OilEndYearExtB2)
			, sum(r.OilEndearEcoB2)
			, sum(r.OilEndYearGeoC1)
			, sum(r.OilEndearGeoC2)
			, sum(r.OilEndYearExtC1)
			, sum(r.OilEndYearExtC2)
			/* добыча + накопл. нефть */
			, sum(r.OilProduction)
			, sum(r.OilEndYearCumulativeProduction)
			/* начальные р.г. */
			, sum(r.DGEndYearExtAB1C1)
			, sum(r.DGEndYearExtB2C2)
			/* годовые р.г. */
			, sum(r.DGEndYearExtAB1)
			, sum(r.DGEndYearExtB2)
			, sum(r.DGEndYearExtC1)
			, sum(r.DGEndYearExtC2)
			/* добыча + накопл. р.г. */
			, sum(r.DGProduction)
			, sum(r.DGEndYearCumulativeProduction)
		from #reserves r
		where r.rowtype = 3
		group by r.guid_sub

	select
			  r.RowType
			, r.GUID_Sub
			, isnull(ss.subshort_name, ss.subname) Sub
			, r.GUID_Company
			, case when r.guid_company = '00000000-0000-0000-0000-000000000000' then 'Нераспределенный фонд' else isnull(cad.name + coalesce(' (' + cad.ownership + ')', ''),'Компания не определена') end Company
			, r.GUID_Object
			, bdforname.objectname Object
			/* начальные нефть */
			, r.OilFirstYearGeoAB1C1
			, r.OilFirstYearGeoB2C2
			, r.OilFirstYearExtAB1C1
			, r.OilFirstYearExtB2C2
			/* годовые нефть */
			, r.OilEndYearGeoAB1
			, r.OilEndYearGeoB2
			, r.OilEndYearExtAB1
			, r.OilEndearEcoAB1
			, r.OilEndYearExtB2
			, r.OilEndearEcoB2
			, r.OilEndYearGeoC1
			, r.OilEndearGeoC2
			, r.OilEndYearExtC1
			, r.OilEndYearExtC2
			/* добыча + накопл. нефть */
			, r.OilProduction
			, r.OilEndYearCumulativeProduction
			/* начальные р.г. */
			, r.DGEndYearExtAB1C1
			, r.DGEndYearExtB2C2
			/* годовые р.г. */
			, r.DGEndYearExtAB1
			, r.DGEndYearExtB2
			, r.DGEndYearExtC1
			, r.DGEndYearExtC2
			/* добыча + накопл. р.г. */
			, r.DGProduction
			, r.DGEndYearCumulativeProduction
		from #reserves r
			left join ext_companys cad on cad.guid = r.guid_company
			left join ext_ssub ss on ss.guid = r.guid_sub
			left join ext_balancehc_deposit bdforname on bdforname.guid = r.guid_objectforname
		order by sub, case when r.guid_company = '00000000-0000-0000-0000-000000000000' then 1 else 0 end, company, Object

end
GO
